import {motion, useTransform, useScroll} from 'framer-motion';
import {useRef} from 'react';

function useParallax(value, distance) {
    return useTransform(value, [0, 1], [-distance, distance]);
  }

const Content = ({exps, darkMode}) => {
    const darkBG = darkMode ? 'bg-gray-900' : 'bg-neutral-100';
    const darkText = darkMode ? 'text-[#D1D2D3]' : 'text-gray-900';
    const darkBorder = darkMode ? 'border-[#D1D2D3]' : 'border-gray-900';

    const work = useRef(null);
    const { scrollYProgress } = useScroll({ target: work });
    const y = useParallax(scrollYProgress, 300);
    const p = [];
    exps.forEach(({id,univname, stream, content, date}) => p.push(
        <div className='w-full h-[25%] flex flex-row even:flex-row-reverse justify-center text-center'>
            <div className={` w-[49%] h-[40%] flex flex-col justify-center items-center text-right px-4`}>
                <span className='text-[1.2rem] font-light'>{date}</span>
            </div>
            <div className={`w-[5%] h-full flex flex-col`}></div>
            <div className=' w-[5%] h-full flex flex-col items-center text-center'>
                <span className={`w-[0%] border ${darkBorder} h-[15%]`}></span>
                <span className={`${darkText} w-full border rounded-full p-2`}><i className='fa fa-graduation-cap'></i></span>
                <span className={`w-[0%] border ${darkBorder} h-full`}></span>
            </div>
            <div className='w-[5%] h-fit flex flex-col '></div>
            <div className={`${darkBG} ${darkText} relative w-[49%] h-[80%] border border-transparent flex flex-col text-left rounded-xl px-4 py-4
                before:content-[''] before:absolute before:top-[30px] ${id%2 != 0 ? "before:-left-3" : "before:-right-3"} before:rotate-45 before:bg-inherit before:border before:border-l-transparent before:border-b-transparent before:border-t-0 before:border-r-0 before:p-[12px]`}>
                <div className={`border-b ${darkBorder} flex flex-col`}>
                    <span className='text-[1.3rem] font-normal'>{univname}</span>
                    <span className='text-[1rem] font-light'>{stream}</span>
                </div>
                <ul className='pt-2 font-light'>
                    {content.map((obj) => <li>{obj}</li>)}
                </ul>
            </div>
        </div>
    ))
    return (
        <section id="academics" className='relative h-[100vh] snap-center flex flex-col justify-center items-center px-8 pt-10'>
            {p}
          <span className="fixed bottom-0 left-0 right-0 w-full p-2 bg-gray-300 text-center">Download Resume <i className="fa fa-download"></i></span>

        </section>
    )
}

const Workex = ({darkMode}) => {
    const exps = [
        {
            "id":1,
            "univname": "Binghamton University",
            "stream": "Master's in Computer Science",
            "content": ["Data structres and algorithms", "Utilized tools like GitHub, VSCode, Docker"],
            "date": "August 2022 - Present"
        },
        {
            "id":2,
            "univname": "Accenture Pvt Ltd",
            "stream": "Internship",
            "content": ["Operating Systems", "Utilized tools like GitHub, VSCode, Docker"],
            "date": "September 2020 - June 2021"
        },
        {
            "id":3,
            "univname": "VR Siddhartha Engineering College",
            "stream": "Bachelor's in Computer Science",
            "content": ["Data structres and algorithms", "Utilized tools like GitHub, VSCode, Docker"],
            "date": "July 2018 - May 2022"
        },
        {
            "id":4,
            "univname": "Saadrusso technology solution",
            "stream": "Backend Developer",
            "content": ["I used this technologies Golang, SQLite, VSCode, API"],
            "date": "Jan 2022 - Apr 2022"
        }
    ]
    return (
        <Content exps={exps} darkMode={darkMode} />
    )
}

export default Workex;




